	const [accessToken, setAccessToken] = useState();
	const [refreshToken, setRefreshToken] = useState();
	const [expiresIn, setExpiresIn] = useState();

	useEffect(() => {
		axios
			.post("http://localhost:3001/login", {
				code,
			})
			.then((response) => {
				console.log(response.data);
			});
	}),
		[code];

	return <div></div>;
};

export default useAuth;
